app.controller("profileController",["$scope",e=>{e.init=((r,o)=>{e.amazon_base_url=r;let t=JSON.parse(o);console.log(t),e.myAdsTitle=t.myAds.title,e.no_results=t.myAds.no_results,e.settings=t.myAds.settings,e.edit=t.myAds.edit,e.buy_power=t.myAds.buy_power,e.unpublish=t.myAds.unpublish})}]),app.config(["$routeProvider",e=>{e.when("/myads",{templateUrl:"partials/profile/myads.jade",controller:"myAdsController"}).when("/buypower/:id",{templateUrl:"partials/profile/buyPower.jade",controller:"buyPowerController"}).when("/messages/:id?",{templateUrl:"partials/profile/messages.jade",controller:"messagesController"}).when("/myfavourites",{templateUrl:"partials/profile/myFavourites.jade",controller:"myFavouritesController"}).otherwise({redirectTo:"/myads"})}]).run(["$rootScope","$location",function(e,r){e.$watch(function(){return r.path()},r=>{e.activetab=r.split("/")[1]})}]);